import React from "react";
import Header from "./Header";
import NotFoundPage from "./NotFoundPage";
import Nav from "./Nav";
import { Route, Switch } from "react-router-dom";
import Home from "./Home";
import WholeTutorial from "./components/WholeTutorial";
import { lessonList } from "./lessons/lessons";

function App(props) {
  const routeLessons = lessonList().map(lesson => (
    <Route
      path={"/" + lesson.title}
      render={props => <WholeTutorial lesson={lesson} isAuthed={true} />}
    />
  ));
  return (
    <div className="general">
      <Header />
      <div className="row">
        <div className="col-sm-2">
          <Nav />
        </div>
        <div className="col-sm-10">
          <Switch>
            <Route path="/" exact render={props => <Home isAuthed={true} />} />
            console.log({routeLessons})
            <Route component={NotFoundPage} />
          </Switch>
        </div>
      </div>
    </div>
  );
}

export default App;
